DROP TABLE IF EXISTS wordpress;


CREATE TABLE wordpress(
    id INT PRIMARY KEY AUTO_INCREMENT,
    origen VARCHAR(100),
    programa VARCHAR(150),
    paquete_captura VARCHAR(100),
    marca VARCHAR(2),
    cs VARCHAR(2),
    cn VARCHAR(2),
    pg_2020_1 VARCHAR(2),
    pg_2020_2 VARCHAR(2),
    pg_2020_3 VARCHAR(2),
    pg_2020_4 VARCHAR(2),
    pg_2020_5 VARCHAR(2),
    pg_2020_6 VARCHAR(2),
    id_pad VARCHAR(100),
    tarjeta VARCHAR(100),
    ap_paterno VARCHAR(100),
    ap_materno VARCHAR(100),
    nombre VARCHAR(100),
    edad VARCHAR(10),
    genero VARCHAR(100),
    curp VARCHAR(50),
    cve_elector VARCHAR(100),
    celular VARCHAR(25),
    r VARCHAR(30),
    local VARCHAR(30),
    r5 VARCHAR(30),
    r6 VARCHAR(30),
    cp VARCHAR(30),
    localidad VARCHAR(30),
    colonia VARCHAR(100),
    calle VARCHAR(100),
    mz VARCHAR(50),
    lote VARCHAR(50),
    ext VARCHAR(50),
    in_t VARCHAR(50)
)ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;





